import React from "react";

import { Link } from 'react-router-dom';
import './ProfileDropdown.css'

export const ProfileDropdown = (props)=>{
    console.log(props)
    return(
        
        <div class="dropdown">
        <button class="dropbtn">Dropdown</button>
            <div class="dropdown-content">
            <a href="#">Link 1</a>
            <a href="#">Link 2</a>
            <a href="#">Link 3</a>
            </div>
      </div>
        
    )
}
